import React from "react";
import { BrowserRouter as Router, Route, Routes, Navigate } from "react-router-dom";
import Home from "./components/Home";
import AboutUs from "./components/AboutUs";
import ContactUs from "./components/ContactUs";
import PrivacyPolicy from "./components/PrivacyPolicy";
import Login from "./components/Login";
import ContentCreation from "./components/ContentCreation";
import Register from "./components/Register";
import Survey from "./components/Survey";
import UserProfile from "./components/UserProfile";
import Connect from "./Connect";
import Protected from "./routes/Protected";

const hasToken = () => !!localStorage.getItem("token");

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<AboutUs />} />
        <Route path="/contact" element={<ContactUs />} />
        <Route path="/privacy" element={<PrivacyPolicy />} />
        
        <Route
          path="/login"
          element={hasToken() ? <Navigate to="/connect" replace /> : <Login />}
        />
        <Route
          path="/register"
          element={hasToken() ? <Navigate to="/connect" replace /> : <Register />}
        />
        <Route path="/survey" element={<Survey />} />

        <Route path="/connect" element={<Protected><Connect /></Protected>} />
        <Route path="/content-creation" element={<Protected><ContentCreation /></Protected>} />
        <Route path="/schedule" element={<Protected><div style={{ padding: "2rem" }}>Schedule Page - Coming Soon</div></Protected>} />
        <Route path="/analytics" element={<Protected><div style={{ padding: "2rem" }}>Analytics Page - Coming Soon</div></Protected>} />
        <Route path="/my-posts" element={<Protected><div style={{ padding: "2rem" }}>My Posts Page - Coming Soon</div></Protected>} />
        <Route path="/profile" element={<Protected><UserProfile /></Protected>} />
        <Route path="/settings" element={<Protected><div style={{ padding: "2rem" }}>Settings Page - Coming Soon</div></Protected>} />

        <Route path="*" element={<Navigate to="/" replace />} />
      </Routes>
    </Router>
  );
};

export default App;
